import React from 'react';
import Blog from '../MAIN/Blog';

function Blogs({ blogs }) {
  return (
    <div className="blogs-list">
      {blogs.map((blog) => (
        <Blog key={blog.id} blog={blog} />
      ))}
    </div>
  );
}

export default Blogs;
